measurements.description:
Seventy-seven flowers and seven buds on 31 15-cm inflorescences;
 sepals oblanceolate, bright yellow;
 petals orbicular, bright yellow;
 lip open, auriculate, ruffled margin, 
yellow overlaid red centrally, callus bright yellow, side lobes yellow;
 column cream, anther cap cream;
 substance firm; texture satin.
